import React from 'react';

const Link = ({original,shortened}) => {
    return(
        <div className='link'>
        <div className='originalLink'>{original}</div>
        <div className='rightSide'>
            <div className='shortenedLink'>{shortened}</div>
            <button>Copy</button>
        </div>
        </div>
    )
}

export default Link;
